var RemoteSelectField = React.createClass({displayName: "RemoteSelectField",
	loadOptions: function(input, callback) {
		
		input = input.toLowerCase();
		
		var rtn = {
			options: [
				{ label: 'One', value: 'one' },
				{ label: 'Two', value: 'two' },
				{ label: 'Three', value: 'three' }
			],
			complete: true
		};
		
		if (input.slice(0,1) === 'a') {
			if (input.slice(0,2) === 'ab') {
				rtn = {
					options: [
						{ label: 'AB', value: 'ab' },
						{ label: 'ABC', value: 'abc' },
						{ label: 'ABCD', value: 'abcd' }
					],
					complete: true
				};
			} else {
				rtn = {
					options: [
						{ label: 'A', value: 'a' },
						{ label: 'AA', value: 'aa' },
						{ label: 'AB', value: 'ab' }
					],
					complete: false
				};
			}
		} else if (!input.length) {
			rtn.complete = false;
		}
		
		setTimeout(function() {
			callback(null, rtn);
		}, 500);
		
	},
	render: function() {
		return React.createElement("div", null, 
			React.createElement("label", null, this.props.label), 
			React.createElement(Select, {asyncOptions: this.loadOptions, className: "remote-example"})
		);
	}
});

var sortAlpabetically = function(dataSet, sortField)
{
	console.log(dataSet);
	dataSet.sort(function (a, b) {
	  if (a[sortField] > b[sortField]) {
	    return 1;
	  }
	  if (a[sortField] < b[sortField]) {
	    return -1;
	  }
	  // a must be equal to b
	  return 0;
	});
}

var sortReverseAlpabetically = function(dataSet, sortField)
{
	dataSet.sort(function (a, b) {
	  if (a[sortField] > b[sortField]) {
	    return -1;
	  }
	  if (a[sortField] < b[sortField]) {
	    return 1;
	  }
	  // a must be equal to b
	  return 0;
	});
}


